import "../styleComponents/content.css";
import Pic from "../bgimg.png"
import Footer from "./footer";
import Button from "./button";

const Content = () => {
    return (
        <div className="container">
            <img className="img" src={Pic} alt="img"/>
        </div>
    )
}

export default Content;
